/*
*
* Pagination custom
* --------------------------------------------------
*/
.pagination-custom {
	display: inline-table;
	margin-bottom: -10px;
	margin-left: -10px;
}

.pagination-custom:empty {
	margin-bottom: 0;
	margin-left: 0;
}

.pagination-custom > * {
	display: inline-block;
	margin-top: 0;
	margin-bottom: 10px;
	margin-left: 10px;
}

.pagination-custom > li,
.pagination-custom > li > a {
	border-radius: 10px;
}

.pagination-custom > li {
	font-family: "Oswald", Helvetica, Arial, sans-serif;
	font-size: 16px;
	letter-spacing: 0.12em;
	min-width: 50px;
	color: #ffffff;
	background: #ed1c94;
	vertical-align: middle;
}

.pagination-custom > li > a {
	display: block;
	height: 50px;
	line-height: 50px;
	vertical-align: middle;
	color: inherit;
	background: inherit;
	text-align: center;
}

.pagination-custom > li > a:hover {
	color: #ffffff;
	background: #6d0eb1;
}

.pagination-custom > li.disabled,
.pagination-custom > li.active {
	pointer-events: none;
}

.pagination-custom > li.active {
	color: #ffffff;
	background: #6d0eb1;
}

.pagination-custom > li.disabled {
	color: #ffffff;
	background: #f47bc1;
}

.pagination-custom .pagination-control a::before {
	color: inherit;
	font-family: "Material Design Icons";
}

.pagination-custom .pagination-control:first-child a::before {
	content: '\f14a';
}

.pagination-custom .pagination-control:last-child a::before {
	content: '\f14f';
}

* + .pagination-custom {
	margin-top: 30px;
}

