	position: relative;
	overflow: hidden;
	border-radius: 9px;
	background: #f2f3f9;
	text-align: left;
}

.post-classic .post-blog-video, .post-classic .post-blog-video figure {
	border-radius: 0;
}

.post-classic-media {
	display: block;
	position: relative;
	overflow: hidden;
	min-height: 250px;
	border-radius: 9px 9px 0 0;
	background: #29293a;
}

.post-classic-media figure {
	min-height: inherit;
}

.post-classic-media img {
	position: absolute;
	top: 50%;
	left: 50%;
	max-width: none;
	max-height: none;
	min-width: 100%;
	min-height: 100%;
	transform: translate(-50%, -50%);
	opacity: 1;
	transition: .33s;
}

.post-classic-media .post-classic-video {
	min-height: inherit;
}

.post-classic-media:hover > img {
	opacity: .8;
	transform: translate(-50%, -50%) scale3d(1.05, 1.05, 1.05);
}

.post-classic-media .post-blog-video:hover img {
	transform: translate(-50%, -50%) scale3d(1.05, 1.05, 1.05);
}

@supports (object-fit: cover) {
	.post-classic-media > img {
		left: auto;
		top: auto;
		object-fit: cover;
		transform: none;
		object-position: center 20%;
		width: 100%;
		height: 100%;
		min-height: inherit;
	}
	.post-classic-media:hover > img {
		transform: scale3d(1.05, 1.05, 1.05);
	}
}

.post-quote-wrap {
	display: flex;
