/*
*
* Style Switcher
* --------------------------------------------------
*/
.style-switcher-panel-wrap {
	position: relative;
	z-index: 15;
	width: 100%;
	padding: 0 15px;
	text-align: center;
}

.style-switcher-panel {
	position: relative;
	z-index: 11;
	margin-bottom: -10px;
	margin-left: -10px;
	will-change: transform;
	text-align: center;
}

.style-switcher-panel:empty {
	margin-bottom: 0;
	margin-left: 0;
}

.style-switcher-panel > * {
	display: inline-block;
	margin-top: 0;
	margin-bottom: 10px;
	margin-left: 10px;
}

.style-switcher-panel > li {
	transform: translate3d(0, 0, 0);
	overflow: hidden;
}

.style-switcher-panel > li.active .button {
	background: #6d0eb1;
	border-color: #6d0eb1;
}

.style-switcher-panel .button {
	padding: 10px 28px;
	min-width: 90px;
	font-size: 14px;
	-webkit-mask-image: -webkit-radial-gradient(white, black);
}

.style-switcher-panel .button, .style-switcher-panel .button:focus {
	color: #29293a;
	background-color: #ffffff;
	border-color: #ededed;
}

.style-switcher-panel .button:hover, .style-switcher-panel .button:active, .style-switcher-panel .button:hover {
	color: #ffffff;
	background-color: #981df0;
	border-color: #981df0;
}

.style-switcher-panel .button:hover {
	background: #6d0eb1;
	border-color: #6d0eb1;
}

.style-switcher-panel > li.active .button {
	color: #ffffff;
	border-color: #981df0;
	background: #981df0;
}

.style-switcher-container {
	position: relative;
}

.style-switcher-container .section {
	transition: .33s;
}

.style-switcher-toggle-wrap {
	position: relative;
	z-index: 10;
	text-align: center;
}

@media (max-width: 767.98px) {
	.style-switcher-panel-wrap {
		position: relative;
	}
	.style-switcher-panel-wrap .style-switcher-panel-control {
		display: block;
		margin-left: auto;
		margin-right: auto;
		padding: 10px 20px;
		color: #ffffff;
		background: #981df0;
		box-shadow: none;
		border: 0;
	}
	.style-switcher-panel-wrap .style-switcher-panel-control::after {
		position: relative;
		top: -1px;
		display: inline-block;
		margin-left: 5px;
		content: '\f107';
		font-family: 'FontAwesome';
		font-size: 14px;
		transition: .22s;
		will-change: transform;
	}
	.style-switcher-panel-wrap .style-switcher-panel-control.active::after {
		transform: scale(1, -1);
	}
	.style-switcher-panel {
		position: absolute;
		bottom: -5px;
		left: 50%;
		padding: 10px;
		margin: 0;
		min-width: 240px;
		transform-origin: 50% 0;
		transform: translate3d(-50%, 100%, 0);
		border: 1px solid #d8dae2;
		opacity: 0;
		visibility: hidden;
		background: #ffffff;
		will-change: transform;
		transition: transform 0.32s cubic-bezier(1, 0.54, 0.15, 0.86), opacity 0.2s ease;
		border-radius: 18px;
	}
	.style-switcher-panel.active {
		opacity: 1;
		visibility: visible;
		transform: translate3d(-50%, 100%, 0);
	}
	.style-switcher-panel li {
		display: block;
		width: 100%;
		margin: 0;
	}
	.style-switcher-panel li + li {
		margin-top: 5px;
	}
	.style-switcher-panel .button {
		padding: 4px 18px;
		width: 100%;
		border: 0;
		text-align: left;
		text-transform: none;
		font-family: "Lato", Helvetica, Arial, sans-serif;
		color: #29293a;
		letter-spacing: 0;
		font-weight: 300;
		background-color: transparent;
	}
	.style-switcher-panel > li.active > .button,
	.style-switcher-panel .button:hover {
		color: #ed1c94;
		background-color: transparent;
	}
}

@media (min-width: 768px) {
	.style-switcher-panel-wrap .style-switcher-panel-control {
		display: none;
	}
}

* + .style-switcher {
	margin-top: 30px;
}

* + .section-offset,
* + .style-switcher-container {
	margin-top: 20px;
}

.style-switcher-toggle-wrap + * {
	margin-top: 20px;
}

