	}
	.desktop .style-switcher-container:hover .style-switcher-toggle {
		top: 35px;
		opacity: 1;
		transform: translateX(-50%);
	}
	.desktop .style-switcher-toggle-wrap + * {
		margin-top: 0;
	}
}

@media (min-width: 1600px) {
	.desktop .style-switcher-container .style-switcher-toggle {
		top: 45px;
	}
	.desktop .style-switcher-container:hover .style-switcher-toggle {
		top: 60px;
	}
}

