.cp-container {
	position: relative;
	width: 104px;
	/* 200 - (2 * 48) */
	height: 104px;
	background: url("../assets/bgr.jpg") 0 0 no-repeat;
	padding: 48px;
	-webkit-tap-highlight-color: rgba(0, 0, 0, 0);
	box-sizing: content-box;
	margin-bottom: 20px;
}

@media (min-width: 480px) {
	.prototype-wrapper {
		display: flex;
		justify-content: space-around;
	}
}

.cp-container :focus {
	border: none;
	outline: 0;
}

.cp-buffer-1,
.cp-buffer-2,
.cp-progress-1,
.cp-progress-2 {
	position: absolute;
	top: 0;
	left: 0;
	width: 104px;
	height: 104px;
	clip: rect(0px, 52px, 104px, 0px);
	-moz-border-radius: 52px;
	border-radius: 52px;
}

/* FALLBACK for .progress
 * (24 steps starting from 1hr filled progress, Decrease second value by 104px for next step)
 * (It needs the container selector to work. Or use div)
 */
.cp-container .cp-fallback {
	background: url("../assets/progress_sprite.jpg") no-repeat;
	background-position: 0 104px;
}

.cp-progress-1,
.cp-progress-2 {
	background: url("../assets/progress.png") 0 0 no-repeat;
}

.cp-buffer-holder,
.cp-progress-holder,
.cp-circle-control {
	position: absolute;
	width: 104px;
	height: 104px;
}

.cp-circle-control {
	cursor: pointer;
}

.cp-buffer-holder,
.cp-progress-holder {
	clip: rect(0px, 104px, 104px, 52px);
	display: none;
}

/* This is needed when progress is greater than 50% or for fallback */
.cp-buffer-holder.cp-gt50,
.cp-progress-holder.cp-gt50,
.cp-progress-1.cp-fallback {
	clip: rect(auto, auto, auto, auto);
}

.cp-controls {
	margin: 0;
	padding: 26px;
}

.cp-controls li {
	list-style-type: none;
	display: block;
	/*IE Fix*/
	position: absolute;
}

